import React, { useState } from 'react'
import Login from './components/Login'
import RegisterForm from './components/RegisterForm'
import PoliceTabs from './components/PoliceTabs'

function App() {
  const [token, setToken] = useState(null)
  const [isRegistering, setIsRegistering] = useState(false)
  const [username, setUsername] = useState('')

  const handleLogin = (newToken, role, name) => {
    setToken(newToken)
    setUsername(name)
  }

  const handleLogout = () => {
    setToken(null)
    setUsername('')
  }

  if (!token) {
    return isRegistering
      ? <RegisterForm onBack={() => setIsRegistering(false)} />
      : <Login onLogin={handleLogin} onShowRegister={() => setIsRegistering(true)} />
  }

  return <PoliceTabs username={username} onLogout={handleLogout} />
}

export default App
